class Command(BaseCommand):
    args = ''
    help = 'Tests how long each view takes to load'
    
    def handle(self, *args, **options):
        for (filename, width, height, shutter, aperture, focal_length, 
            flash) in pics:
            
            if Photo.objects.filter(filename=filename).count():
                continue
            
            photo = Photo()
            photo.filename = filename
            photo.width = width
            photo.height = height
            photo.shutter_speed = shutter
            photo.aperture = aperture
            photo.focal_length = focal_length
            photo.flash = flash
            photo.save()